import React from 'react'
import Slider from '../Component/Slider'
import Reportfrom from '../Component/Reportfrom'
import Labsteps from '../Component/Labsteps'
import Organ from '../Component/Organ';
import Categories from '../Component/Categories';
import Organadd from '../Addvertisement/Organadd';
import Packeges from '../Component/Packeges';
import Testcard from '../Component/Testcard'
import Testadd from '../Addvertisement/Testadd';
import Profiletest from '../Component/Profiletest';
import Womanstaps from '../Component/Womanstaps';
import Womanorgan from '../Component/Womanorgan';
import Womantest from '../Component/Womantest';
import Womanadd from '../Addvertisement/Womanadd';






function Home() {
    return (
        <>

            <Slider />
            <Reportfrom />
            <Labsteps />
            <Organ />
            <Categories />
            <Organadd />
            <Packeges />
            <Testcard />
            <Profiletest />
            <Testadd />
            <Womanstaps />
            <Womanorgan />
            <Womantest />
            <Womanadd />





        </>
    )
}

export default Home
